import Link from "next/link";

const LandingHeader = () => (
  <>
    <Link href="/">
      <a className="logo">Woo Young Choi</a>
    </Link>
    <style jsx>
      {`
        .logo {
          color: #00ace6;
          display: block;
          font-family: "Georgia, serif";
          font-size: 20px;
          float: right;
          padding-bottom: 5px;
          text-decoration: none;
        }
      `}
    </style>
  </>
);

export default LandingHeader;
